import React from "react";
import { Link, Outlet } from "react-router-dom";
const Menu = () => {
  return (
    <>
      <nav className="d-flex flex-row-reverse">
        <Link to="/Q3" className="m-1">
          <button className="btn btn-primary">Q3</button>
        </Link>
        <Link to="/Q4" className="m-1">
          <button className="btn btn-primary">Q4</button>
        </Link>
        <Link to="/Q5" className="m-1">
          <button className="btn btn-primary">Q5</button>
        </Link>
        <Link to="/Q6" className="m-1">
          <button className="btn btn-primary">Q6</button>
        </Link>
      </nav>
        <Outlet />
    </>
  );
};

export default Menu;
